import { useEffect } from "react";
import useImages from "../hooks/useImages";
import Canel from "./Heart";

export default function Favoritos() {
  const { favoritos, favorito,eliminarFavorito } = useImages();

  console.log("desde favoritos", favoritos);

  return (
    <>
    {favorito !== '' ? <h1>Fotos favoritas</h1> : <h1>Aún no seleccionas tus fotos favoritas</h1>}
   
      <div className="galeria grid-columns-5 p-3">
        {favoritos.map((imagen) => (
          <img onClick={eliminarFavorito} key={imagen.id} src={imagen.src.tiny}></img>
        
        ))}

        <Cancel/>
      </div>
    </>
  );
}

